import React from "react";
import { Col, Container, Row } from "react-bootstrap";
import CrearRol from "../componentes/Prueba/CrearRol";

const StudUpdate = () => {
  return (
    <Container>
      <Col className="d-flex justify-content-center">
        <Row
          className="row row-cols-2 align-self-center rounded-start rounded-end"
          style={{ backgroundColor: "#68AEDB", width: "550px"}}
        >
          <Col className="text-center">
            <h1>PAPA PEDRO</h1>
          </Col>

          <Col className="d-flex justify-content-end">
            <Row className="row row-cols-2 flex-fill">
              <Col className="col-4 offset-4" style={{ backgroundColor: "#DEC618" }}></Col>

              <Col className="col-4 rounded-end" style={{ backgroundColor: "#9900FF" }}></Col>
            </Row>
          </Col>
        </Row>
      </Col>
    </Container>
  );
};

export default StudUpdate;
